import React from 'react';
import './Home.css';
import bgImg from '../../assets/img/header-min.webp';
import SearchPanel from '../../components/SearchPanel/SearchPanel';

function Home() {
    return (
        <main id="main-content">
            <section className="section-block index-heading">
                <img src={bgImg} alt=""></img>
            </section>
            <SearchPanel />
            <section className="section-block">
                <div className="section-block__title">
                    <h3>Lokalita</h3>
                </div>
                <div className="section-block__desc"></div>
            </section>
        </main>
    )
}

export default Home;
